var sampleImage = `data:image/png;base64,`

function Message(from, isRead, sentAt, body, user) {
  this.isRead = isRead
  this.from = from
  this.sentAt = sentAt
  this.body = body
  this.user = user
}

new Vue({
  el: "#app",
  vuetify: new Vuetify(),
  data(vm) {
    return {
      snackbar: null,
      snackbarText: null,
      dialog: false,
      users: [
        'Dianne Bell',
        'Cameron Hawkk',
        'Jennie Williamm',
        'Pat Henry'
      ],
      houseNumbers: [
        '12/111',
        '12/112'
      ],
      selectedUser: null,
      message: '',
      messages: [
        new Message('user', true, new Date(), '', 'Dianne Bell'),
        new Message('user', true, new Date(), sampleImage, 'Dianne Bell'),
        new Message('user', true, new Date(), '', 'Dianne Bell'),
        new Message('staff', true, new Date(), ' ', 'Dianne Bell'),
        new Message('user', true, new Date(), ' 11  ', 'Dianne Bell'),
        new Message('staff', true, new Date(), '', 'Dianne Bell'),
        new Message('system', true, new Date(), 'The Base Staff completed case', 'Dianne Bell'),
        new Message('system', true, new Date(), 'The Base Staff completed case', 'Dianne Bell'),
      ],
      imageName: null,
    };
  },
  computed: {
    selectedUsernameShort() {
      if (!this.selectedUser) return ''
      
      const [firstName, lastName] = this.selectedUser.split(' ')
      
      return firstName[0] + lastName[0]
    },
    selectedUsername() {
      if (!this.selectedUser) return ''
            
      return this.selectedUser
    }
  },
  updated() {
    console.log(this.message)
  },
  mounted() {
    this.selectedUser = this.users[0]
    fileReader = new FileReader()
    fileReader.onload = (e) => {
      this.message = e.target.result
    }
    document.getElementById('file').addEventListener('change', (e) => {
      fileReader.readAsDataURL(e.target.files[0])
    })
  },
  methods: {
    sendMessage() {
      this.messages.push(new Message('staff', false, new Date(), this.message, this.selectedUser))
    },
    completeCase() {
      this.messages.push(new Message('system', false, new Date(), 'The Base Staff completed case', this.selectedUser))
      this.dialog = false
      this.snackbar = true
      this.snackbarText = 'Completed case'
    }
  }
});
